import React from 'react';

function Home() {
  return (
    <div className="home">
      <div className="main-content">
        <section className="project-section">
          <h2>My Projects</h2>
          <div className="project">
            <div className="project-image">
              {/* Insert an image of your project */}
              <img src="project-image.jpg" alt="Project 1" />
            </div>
            <div className="project-description">
              <h3>Project Title 1</h3>
              <p>Project description goes here. You can describe your project, technologies used, and any other relevant information.</p>
              <pre>
                {/* Insert your code here */}
                <code>
                  // Your code snippet
                  function example() {
                    // Code example
                  }
                </code>
              </pre>
            </div>
          </div>
          {/* Add more project entries as needed */}
        </section>
      </div>
    </div>
  );
}

export default Home;
